 {\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 \r\n\\par (}{\\rtlch\\fcs1 \\ab\\af37\\afs24 \\ltrch\\fcs0 \\b\\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 *NOT Caleta de Maro, don\\rquote t confuse the beaches*}{\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 .)\r\n\\par \r\n\\par This would be (approximately) the place to park your car and take the bus down to Maro beach.\r\n\\par }{\\field\\fldedit{\\*\\fldinst {\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 HYPERLINK \"https://goo.gl/maps/ZfNzUsfkCN1q8iD47\" \\\\t \"_blank\"}{\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \r\n\\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 {\\*\\datafield }}}{\\fldrslt {\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \\f43\\fs24\\ul\\cf23\\kerning0\\insrsid4475557\\charrsid4475557 https://goo.gl/maps/ZfNzUsfkCN1q8iD47}}}\\sectd \\ltrsect\r\n\\linex0\\headery708\\footery708\\colsx708\\endnhere\\sectlinegrid360\\sectdefaultcl\\sectrsid14962447\\sftnbj {\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 \r\n\\par \r\n\\par \r\n\\par \r\n\\par }{\\rtlch\\fcs1 \\ab\\af37\\afs24 \\ltrch\\fcs0 \\b\\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 *IMPORTANT*:}{\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 \r\n\\par Remember that you must be at the company\\rquote s counter (Maro Kayak Nerja, which is right when you arrive at the beach)\\~}{\\rtlch\\fcs1 \\ab\\af37\\afs24 \\ltrch\\fcs0 \\b\\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 *15 minutes before the activity\r\n\\rquote s departure time*}{\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 \\~if you are late, the reservation will be canceled and there will be no refund of the amount paid.\r\n\\par \r\n\\par You don\\rquote t need to queue, go directly to the counter and tell them you have a reserved route.\r\n\\par \r\n\\par If you have any issues, please contact us by sending a }{\\rtlch\\fcs1 \\ab\\af37\\afs24 \\ltrch\\fcs0 \\b\\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 WhatsApp message at\\~+34645761689}{\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \r\n\\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 \\~indicating the name used to make the reservation and the time you have the activity.\r\n\\par \\line \r\n\\par \\line \r\n\\par \r\n\\par }{\\rtlch\\fcs1 \\ab\\af37\\afs24 \\ltrch\\fcs0 \\b\\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 *GETTING TO MARO BEACH*}{\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 \r\n\\par Maro beach is located in a natural area and vehicles, except for authorized ones, cannot reach the beach.\r\n\\par \r\n\\par If you bring your own vehicle, keep in mind that in high season it can be complicated to find parking, so we recommend that you calculate an hour or more to park and go down to the beach.\r\n\\par \r\n\\par There is a bus service (offered by the Nerja town hall and it is not free, but it is not expensive either: \\'801.5 round trip) that takes you from the main parking lot on the road down to the beach, that bus leaves at the hour o'clock.\r\n\\par You can also walk down to the beach, the estimated time from the parking lot is about 17 minutes.\r\n\\par If you prefer to go by taxi, it will take you near the beach, it will leave you in the same place as the bus/shuttle.\r\n\\par \r\n\\par \r\n\\par \r\n\\par }{\\rtlch\\fcs1 \\ab\\af37\\afs24 \\ltrch\\fcs0 \\b\\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 *WE RECOMMEND:*}{\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 \r\n\\par -\\~}{\\rtlch\\fcs1 \\ab\\af37\\afs24 \\ltrch\\fcs0 \\b\\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 Cap, sunscreen}{\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 \r\n, water, short sleeve shirt to avoid chafing from the life jacket. (For guided tours, we lend you diving goggles without a tube).\r\n\\par - Eat something, at least a piece of fruit, 30 minutes before the activity.\r\n\\par \r\n\\par -\\~}{\\rtlch\\fcs1 \\ab\\af37\\afs24 \\ltrch\\fcs0 \\b\\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 We can keep a backpack with your valuables}{\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 \\~(ke\r\nys, wallet, mobiles, glasses, etc.).\r\n\\par - We do not keep: Towels, coolers, chairs, umbrellas, masks or loose clothing.\r\n\\par - We do not have waterproof bags or containers, everything that goes in the kayak gets wet.\r\n\\par \r\n\\par Our guided tours include a free photo report, which will be shared after 5 days via a WhatsApp link with ALL members of the tour group, as long as there are no technical problems.\r\n\\par \r\n\\par Thank you very much!\r\n\\par \r\n\\par \r\n\\par \r\n\\par }{\\rtlch\\fcs1 \\ab\\af37\\afs24 \\ltrch\\fcs0 \\b\\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 *Please read this*}{\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \\f43\\fs24\\cf22\\kerning0\\insrsid4475557\\charrsid4475557 \r\n, we are in high season and the town of Maro is very small and there are fe\r\nw places to park. If you do not go by taxi to Maro beach, please calculate at least an hour and a half to park and if you do not find any parking in the town, you can go to the parking lot of the Nerja Caves, although it is paid.\r\n\\par I am warning you because if you are not at Maro beach 15 minutes before the activity time, you will lose your reservation.\r\n\\par Thank you for your understanding.\\~}{\\rtlch\\fcs1 \\af37\\afs24 \\ltrch\\fcs0 \\f43\\fs24\\cf22\\lang1024\\langf